import styled from "styled-components";

export const Container = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  flex-direction: column;
  background-color: black;
`;

export const ButtonContainer = styled.div`
  display: flex;
  align-items: center;
  margin: 2cm;
`;
